import {createSlice} from '@reduxjs/toolkit'
const userdata=createSlice({
    name:'usData',
    initialState:{
        infoE:[],
    },
    reducers:{
        dataInfoE:(state,action)=>{
            console.log("******",action.payload);
            console.log("******",action);
            state.infoE.push(action.payload)
        },
        dataRemove:(state)=>{
            state.infoE=[]
        }
    }
})

export const {dataInfo,dataRemove}=userdata.actions
export default userdata.reducer
